         "    Protect or enforce our rights, including to detect fraud or other criminal activities (for example, by using information in payment systems)" : "[대학에~    Protect or enforce our rights, including to detect fraud or other criminal activities (for example, by using information in payment systems)]",
         "    Handle and resolve disputes" : "[대학에~    Handle and resolve disputes]",
